import React from 'react';
import './CSS/App.css';
import { BrowserRouter as Router, Routes, Route } from "react-router-dom";
import UserSignUp from "./CSS/Authentication/signup";
import UserLogin from "./CSS/Authentication/login"; 
import UserLogout from "./CSS/Authentication/logout";
import Home from './Home';

function App() {
  return (
    <Router>
      <div className="authen">
        <h1 className="title">Shelf Aware</h1>
      </div>

      <div className="App">
        <Routes>
          <Route path="/" element={<Home />} /> {/* Home shown after login */}
          <Route path="/signup" element={<UserSignUp />} />
          <Route path="/login" element={<UserLogin />} /> {/* default route */}
        </Routes>
      </div>
    </Router>
  );
}

export default App;
